CREATE TABLE regiones (
	reg_id SERIAL NOT NULL,
	reg_numero_region INT NOT NULL,
	reg_nombre varchar(100) NOT NULL,
	PRIMARY KEY(reg_id));

CREATE TABLE provincias (
	pro_id SERIAL NOT NULL,
	reg_id INT NOT NULL,
	pro_nombre varchar(100) NOT NULL,
	PRIMARY KEY(pro_id));

CREATE TABLE comunas (
	com_id INT SERIAL NOT NULL,
	pro_id INT NOT NULL,
	com_nombre VARCHAR(100) NOT NULL,
	com_conara_sii INT NULL,
	com_cod_tesoreria INT NULL,
	PRIMARY KEY(com_id));

ALTER TABLE provincias
ADD CONSTRAINT fk_provincia_region
FOREIGN KEY (reg_id) REFERENCES regiones(reg_id); 

ALTER TABLE comunas
ADD CONSTRAINT fk_comuna_provincia
FOREIGN KEY (pro_id) REFERENCES provincias(pro_id); 



